
DROP DATABASE IF EXISTS patanhospital_ibs;
CREATE DATABASE patanhospital_ibs;
USE patanhospital_ibs;

DROP TABLE IF EXISTS SwitchboardItems;
CREATE TABLE SwitchboardItems( SwitchboardID INTEGER(32),ItemNumber SMALLINT(16),ItemText VARCHAR(255),Command SMALLINT(16),Argument VARCHAR(50));



DROP TABLE IF EXISTS tblClinicType;
CREATE TABLE tblClinicType( fldClinicID VARCHAR(5),fldClinicName VARCHAR(20),fldRoomNo SMALLINT(16),fldLocation VARCHAR(25),fldColour VARCHAR(15),fldRegFee DOUBLE(12,2),fldMaxTicket SMALLINT(16), PRIMARY KEY(fldClinicID));





DROP TABLE IF EXISTS tblCrHeading;
CREATE TABLE tblCrHeading( fldCrHeadingNo INTEGER(32),fldCrHeadingName VARCHAR(20),fldCrHeadingGroup VARCHAR(20), PRIMARY KEY(fldCrHeadingNo));





DROP TABLE IF EXISTS tblDistrict;
CREATE TABLE tblDistrict( fldDistrictCode SMALLINT(16),fldDistrictName VARCHAR(30), PRIMARY KEY(fldDistrictCode));





DROP TABLE IF EXISTS tblDrHeading;
CREATE TABLE tblDrHeading( fldDrHeadingNo INTEGER(32),fldDrHeadingName VARCHAR(20),fldDrGroup VARCHAR(20),fldRate DOUBLE(12,2),fldMainGroup VARCHAR(20), PRIMARY KEY(fldDrHeadingNo));





DROP TABLE IF EXISTS tblEthnicGroup;
CREATE TABLE tblEthnicGroup( fldEthnicID SMALLINT(16),fldEthnicGroup VARCHAR(30), PRIMARY KEY(fldEthnicID));





DROP TABLE IF EXISTS tblHospital;
CREATE TABLE tblHospital( fldHospitalName VARCHAR(50),fldAddress1 VARCHAR(20),fldAddress2 VARCHAR(20),fldVillageTown VARCHAR(20),fldDistrict VARCHAR(20),fldZone VARCHAR(20),fldRegion VARCHAR(20),fldCountry VARCHAR(15),fldPhone1 INTEGER(32),fldPhone2 INTEGER(32),fldEmail1 VARCHAR(30),fldEmail2 VARCHAR(30),fldWebSite1 VARCHAR(50),fldWebSite2 VARCHAR(50));





DROP TABLE IF EXISTS tblInPatient;
CREATE TABLE tblInPatient( fldRegistrationID INTEGER(32),fldPatientID INTEGER(32),fldAdmissionNo INTEGER(32) AUTO_INCREMENT, fldAdmissionDate DATETIME(5),fldAdmissionYear SMALLINT(16),fldAdmissionMonth SMALLINT(16),fldAdmissionDay INTEGER(32),fldAge SMALLINT(16),fldWardID VARCHAR(20),fldBedNo SMALLINT(16),fldDishargeDate DATETIME(5),fldDischargeYear SMALLINT(16),fldDischargeMonth SMALLINT(16),fldDischargeDay INTEGER(32),fldBillNo INTEGER(32),fldEstimatedAmt DOUBLE(12,2),fldDischarged BOOLEAN, PRIMARY KEY(fldAdmissionNo));





DROP TABLE IF EXISTS tblIPbillCredit;
CREATE TABLE tblIPbillCredit( fldReceiptNo INTEGER(32) AUTO_INCREMENT, fldAdmissionNo INTEGER(32),fldCrHeadingNo INTEGER(32),fldCrHeadingRemark VARCHAR(50),fldPmtDate DATETIME(5),fldPmtYear SMALLINT(16),fldPmtMonth SMALLINT(16),fldPmtDay INTEGER(32),fldAmount DOUBLE(12,2),fldUserID VARCHAR(10), PRIMARY KEY(fldReceiptNo));





DROP TABLE IF EXISTS tblIPbillCreditDetail;
CREATE TABLE tblIPbillCreditDetail( fldReceiptNo INTEGER(32),fldCrHeadingNo INTEGER(32),fldCrHeadingRemark VARCHAR(50),fldAmount DOUBLE(12,2));





DROP TABLE IF EXISTS tblIPcharge;
CREATE TABLE tblIPcharge( fldChargeID INTEGER(32) AUTO_INCREMENT, fldAdmissionNo INTEGER(32),fldChargeHeadingNo INTEGER(32),fldChargeHeadingRemark VARCHAR(50),fldChargeDate DATETIME(5),fldChargeYear SMALLINT(16),fldChargeMonth SMALLINT(16),fldChargeDay INTEGER(32),fldAmount DOUBLE(12,2),fldUserID VARCHAR(10),fldReceiptNo INTEGER(32), PRIMARY KEY(fldChargeID));





DROP TABLE IF EXISTS tblIPchargeDetail;
CREATE TABLE tblIPchargeDetail( fldChargeID INTEGER(32),fldChargeHeadingNo INTEGER(32),fldChargeHeadingRemark VARCHAR(50),fldAmount DOUBLE(12,2));





DROP TABLE IF EXISTS tblIPpaymentDetail;
CREATE TABLE tblIPpaymentDetail( fldlPmtID INTEGER(32),fldAdmissionNo INTEGER(32),fldPmtHeadingNo INTEGER(32),fldPmtDate DATETIME(5),fldPmtYear SMALLINT(16),fldPmtMonth SMALLINT(16),fldPmtDay INTEGER(32),fldAmount DOUBLE(12,2));





DROP TABLE IF EXISTS tblItemList;
CREATE TABLE tblItemList( fldItemCode VARCHAR(10),fldDescription VARCHAR(255),fldItemGroup VARCHAR(20),fldCurrentPrice DOUBLE(12,2), PRIMARY KEY(fldItemCode));





DROP TABLE IF EXISTS tblLabRevenue;
CREATE TABLE tblLabRevenue( fldRegistrationID INTEGER(32),fldReceiptNo INTEGER(32) AUTO_INCREMENT, fldPatientID INTEGER(32),fldCollectionDate DATETIME(5),fldCollectionYear SMALLINT(16),fldCollectionMonth SMALLINT(16),fldCollectionDay SMALLINT(16),fldUserID VARCHAR(10), PRIMARY KEY(fldReceiptNo));





DROP TABLE IF EXISTS tblLabRevenueDetail;
CREATE TABLE tblLabRevenueDetail( fldRegistrationID INTEGER(32),fldReceiptNo INTEGER(32),fldCollectionDate DATETIME(5),fldCollectionYear SMALLINT(16),fldCollectionMonth SMALLINT(16),fldCollectionDay SMALLINT(16),fldItemCode VARCHAR(10),fldQuantity SMALLINT(16),fldAmount DOUBLE(12,2),fldUserID VARCHAR(10));





DROP TABLE IF EXISTS tblNepaliCalendar;
CREATE TABLE tblNepaliCalendar( fldYearBS SMALLINT(16),fldBaishakh1InAD DATETIME(5),fldBaishakh SMALLINT(16),fldJeth SMALLINT(16),fldAsar SMALLINT(16),fldShrawan SMALLINT(16),fldBhadra SMALLINT(16),fldAsoj SMALLINT(16),fldKartik SMALLINT(16),fldMangsir SMALLINT(16),fldPush SMALLINT(16),fldMagh SMALLINT(16),fldFagun SMALLINT(16),fldChait SMALLINT(16),fldBaishakhEndAD DATETIME(5),fldJethEndAD DATETIME(5),fldAsarEndAD DATETIME(5),fldShrawanEndAD DATETIME(5),fldBhadraEndAD DATETIME(5),fldAsojEndAD DATETIME(5),fldKartikEndAD DATETIME(5),fldMangsirEndAD DATETIME(5),fldPushEndAD DATETIME(5),fldMaghEndAD DATETIME(5),fldFagunEndAD DATETIME(5),fldChaitEndAD DATETIME(5), PRIMARY KEY(fldYearBS));





DROP TABLE IF EXISTS tblOPbillDeduction;
CREATE TABLE tblOPbillDeduction( fldRegistrationID INTEGER(32),fldDeductionID INTEGER(32) AUTO_INCREMENT, fldDeductionDate DATETIME(5),fldDeductionYear SMALLINT(16),fldDeductionMonth SMALLINT(16),fldDeductionDay SMALLINT(16),fldUserID VARCHAR(10), PRIMARY KEY(fldDeductionID));





DROP TABLE IF EXISTS tblOPbillDeductionDetail;
CREATE TABLE tblOPbillDeductionDetail( fldDeductionID INTEGER(32),fldCrHeadingNo SMALLINT(16),fldCrHeadingRemark VARCHAR(50),fldAmount DOUBLE(12,2));





DROP TABLE IF EXISTS tblParameters;
CREATE TABLE tblParameters( fldYearBS SMALLINT(16),fldMonthBS SMALLINT(16),fldDayBS SMALLINT(16),fldTodayAD DATETIME(5),fldLastReceiptNo INTEGER(32));





DROP TABLE IF EXISTS tblPatient;
CREATE TABLE tblPatient( fldPatientID INTEGER(32),fldLastname VARCHAR(50),fldName VARCHAR(50),fldEthnicGroup VARCHAR(20),fldVillageTown VARCHAR(50),fldWardNo SMALLINT(16),fldDistrict VARCHAR(20),fldBirthDate DATETIME(5),fldYearBorn SMALLINT(16),fldMonthBorn SMALLINT(16),fldDayBorn SMALLINT(16),fldSex VARCHAR(1),fldGuardiansName VARCHAR(50),fldRelation VARCHAR(50), PRIMARY KEY(fldPatientID));





DROP TABLE IF EXISTS tblPatientRegistration;
CREATE TABLE tblPatientRegistration( fldRegistrationID INTEGER(32) AUTO_INCREMENT, fldPatientID INTEGER(32),fldReceiptNo INTEGER(32),fldRegDate DATETIME(5),fldRegYear SMALLINT(16),fldRegMonth SMALLINT(16),fldRegDay SMALLINT(16),fldClinicID VARCHAR(5),fldRegFeePaid DOUBLE(12,2),fldAge SMALLINT(16),fldTicketNo SMALLINT(16),fldNewOld VARCHAR(1),fldUserID VARCHAR(10), PRIMARY KEY(fldRegistrationID));





DROP TABLE IF EXISTS tblPharmRevenue;
CREATE TABLE tblPharmRevenue( fldRegistrationID INTEGER(32),fldReceiptNo INTEGER(32) AUTO_INCREMENT, fldPatientID INTEGER(32),fldCollectionDate DATETIME(5),fldCollectionYear SMALLINT(16),fldCollectionMonth SMALLINT(16),fldCollectionDay SMALLINT(16),fldUserID VARCHAR(10), PRIMARY KEY(fldReceiptNo));





DROP TABLE IF EXISTS tblPharmRevenueDetail;
CREATE TABLE tblPharmRevenueDetail( fldRegistrationID INTEGER(32),fldReceiptNo INTEGER(32),fldCollectionDate DATETIME(5),fldCollectionYear SMALLINT(16),fldCollectionMonth SMALLINT(16),fldCollectionDay SMALLINT(16),fldItemCode VARCHAR(10),fldQuantity SMALLINT(16),fldAmount DOUBLE(12,2),fldUserID VARCHAR(10));





DROP TABLE IF EXISTS tblPriceList;
CREATE TABLE tblPriceList( fldItemCode VARCHAR(10),fldRate DOUBLE(12,2),fldEffectiveDate DATETIME(5),fldEffectiveYear SMALLINT(16),fldEffectiveMonth SMALLINT(16),fldEffectiveDay SMALLINT(16));





DROP TABLE IF EXISTS tblRegistrationFee;
CREATE TABLE tblRegistrationFee( fldRegistrationID INTEGER(32),fldReceiptNo INTEGER(32) AUTO_INCREMENT, fldCollectionDate DATETIME(5),fldCollectionYear SMALLINT(16),fldCollectionMonth SMALLINT(16),fldCollectionDay SMALLINT(16),fldClinicID VARCHAR(10),fldAge SMALLINT(16),fldRegFeePaid DOUBLE(12,2),fldUserID VARCHAR(10), PRIMARY KEY(fldReceiptNo));





DROP TABLE IF EXISTS tblWardType;
CREATE TABLE tblWardType( fldWardID VARCHAR(10),fldWardDesc VARCHAR(50),fldBedCount SMALLINT(16), PRIMARY KEY(fldWardID));



#New Table for adding functionality in existing system
