DROP TABLE IF EXISTS tblRole;
CREATE TABLE tblRole( fldRoleID INT ,fldRoleName VARCHAR(50), PRIMARY KEY(fldRoleID));


#Added on: 6/10/2018
DROP TABLE IF EXISTS tblUser;
CREATE TABLE tblUser( fldUserID INT AUTO_INCREMENT,fldUserName VARCHAR(50),fldUserPassword VARCHAR(50), fldUserRole INT, fldUserVisible BOOLEAN, PRIMARY KEY(fldUserID));








